import React from 'react'
import styled from 'styled-components'
const Container=styled.div`
width: 350px;
cursor: pointer;
margin-bottom: 70px;
padding: 6.9px;
`
const Img=styled.img`
width: 100%;
height: 200px;
background-color: #999;
`
const Details=styled.div`
display: flex;
gap: 12px;
`
const Channelimg=styled.img`
width: 32px;
height: 32px;
margin-top: 7px;
border-radius: 50%;
background-color: #999;
`
const Texts=styled.div``
export const Vidcard = () => {
  return (
    <Container><Img/>
    <Details>
      <Channelimg/>
    </Details>
    </Container>
  )
}
